import { Routes, Route } from "react-router-dom";
import TableDetails from "./component/TableDetay";
import Home from "./component/Home";
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/detail/:id" element={<TableDetails />}></Route>
      </Routes>
    </>
  );
}

export default App;
